import db from "../Database"; 




function Search() {
    const cats = db.cats;
    return(
        <div>

<h1>This is the search results for you</h1> 
<div className="list-group"> 
    {cats.map((cat) => ( 
    <Link key={cat.id} to={`/detail`} className="list-group-item"> 
    {cat.id}
    {cat.name} 
    </Link> ))} 
</div>
        </div>

    );
 };
 export default Search;
